push array in array field in mongodb<p>I have an array called students in a schema called Course. I created a route that allows me to add students to this array using a student's <code>ObjectID</code> like so:</p>

<pre><code> router.put('/addStudent/:courseID', function (req, res) {
        Course.findOneAndUpdate({courseID: req.params.courseID}, {$push: {students: req.body.students}})
        .populate('students')
        .exec(function (err, course) {

            if (err) return res.status(500).send("There was a problem adding this information to the database");
            res.status(201).send(course);
        })
    });
</code></pre>

<p>When I try making a PUT request to my endpoint with the following JSON body:</p>

<pre><code>{
    "students":["5b1f06cafa355c2d187c344f"]
}
</code></pre>

<p>Nothing happens at all, it just sends me back the course with the student ID not added. How do I make it so I could add more student IDs to the array? I don't want it to replace the array with a student ID, I want to keep adding more as I make more requests.</p>

<p>Thanks!</p>

