Save objects to array type field in mongoose<p>I want to save my array of <code>car</code> object to my user.cars field in mongoose.</p>

<p>My User Schema looks like this:</p>

<pre><code>const UserSchema = new Schema({
    firstName: {
        type: String,
        required: true
    },
    lastName: {
        type: String,
        required: true
    },
    cars: [{
        type: Array,
        required: false
    }]
})
</code></pre>

<p>I'm saving user cars on cars endpoint like this:</p>

<pre><code>router.route('/cars')
  .post(async function (req, res) {
    User.findById(req.user._id)
      .then((user, err) =&gt; {
        if (err) {
           return res.json({err})
        }
        if (user &amp;&amp; user._id) {
           user.cars = req.body.cars 
           user.save(function (err) {
             if (err) {
                res.status(500)
                return res.json({
                   success: false,
                   message: err.message || 'Update failed'
                  })
             }
             ioServer.sockets.emit('update-users')
             res.status(200).json({
                success: true,
                message: 'User updated successfully'
             })
           })
        } else {
          return res.json({message: 'No user', success: false})
        }
      })
      .catch(err =&gt; console.log(err))
  })
</code></pre>

<p>My req.body log looks like:</p>

<pre><code>{ cars: [
    {
        type: 'Sedan',
        make: 'BMW',
        model: '525i',
        [...]
    },
    {
        type: 'Coupe',
        make: 'Subaru',
        model: 'BRZ',
        [...]
    },
    {
        type: 'SUV',
        make: 'Toyota',
        model: 'Rav4',
        [...]
    }
    ]
}
</code></pre>

<p>This code works, but mongoose save data as a new array, so it looks like this:</p>

<pre><code>{ user.cars: [
    [
        {car},
        {car},
        ...
    ]
]}
</code></pre>

<p>But I want to get user.cars as a array of objects instead of passing new array into cars.</p>

<p>Many thanks for help with find where I did a mistake in my code.</p>

